nge, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2956422","type":"CustomJS"},{"attributes":{"coordinates":null,"data_source":{"id":"2956103"},"glyph":{"id":"2956342"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"2956344"},"nonselection_glyph":{"id":"2956343"},"view":{"id":"2956346"}},"id":"2956345","type":"GlyphRenderer"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwcMFndRzu8/iCRB3H/S7z99SPC2to/vP6MIa1Ocgu8/1HHxAvBw7z8bTt7dkTzvPzdUMhbL8e4/FpWhqgHT7j//lsqbP17wPw+OuIxLMPA/Ad7q/s+/7z8ktzp4XkXvP3SkQH+W0O8/RPZgWqQN8D923mHyQTHwP8mJMq81KPA/x4F/k2sH8D90ppDwJO7vP6sxrbQhA/A/pKoUOYf97z/Q2yLoJGbvP/yYgvBChe8/ze9VXrsD7z/iLiat5InuP1NJHLfxPu4/+zxMoOQ87j/f4PHQ4/7tP6Ept1Y7n+0/AE7E9N9A7T8Z4zRmSDztP/BCWm5nsu0/fH/DyHLp7T9VCW31MPbtPw07R7490e0/QN
